import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class Superhero extends Component {
    render() {
        return (
            <div>
                <h1>Thor</h1>
                <img src='./assets/thor.jpg' alt="zbeub zbeub" />
            </div>
        );
    }
}

export default Superhero;
